def poly_type(x):
    x = int(x)
    if x > 5 or x < -1:
        raise argparse.ArgumentTypeError("poly ∈ [-1 ,5]")
    return x


parser = argparse.ArgumentParser()
parser.add_argument('--mpv', action='store_true', help="substitute zeroth order with the MPV")
poly = parser.add_mutually_exclusive_group(required=True)
poly.add_argument('-p', '--poly', type=poly_type, help='-1 -> off; 0 -> f(x) = a; 1 -> f(x) = a+bx²; 2-> f(x) = a+bx+cx²; 3-> f(x) = a+bx+cx²+cx³')

parsed_args = parser.parse_args()


#sums = json.load(open("caldat-linreg.json"))
sums = json.load(sys.stdin)

ncaps = 0
for b_n, board in sums.items():
    for channel in board:
        ncaps += len(channel)
progress_bar = tqdm.tqdm(desc='Cap', total=ncaps)

caldat = {}
for b_n, board in sums.items():
    caldat[b_n] = list()
    for channel in board:
        ll = list()
        for cap in channel:
            capsums = dict(
                    mode    = cap['MPV' ],
                    n       = cap['n'   ],
                    S_x     = cap['t'   ],
                    S_x2    = cap['t2'  ],
                    S_x3    = cap['t3'  ],
                    S_x4    = cap['t4'  ],
                    S_x5    = cap['t5'  ],
                    S_x6    = cap['t6'  ],
                    S_x7    = cap['t7'  ],
                    S_x8    = cap['t8'  ],
                    S_x9    = cap['t9'  ],
                    S_x10   = cap['t10' ],
                    S_y     = cap['Cp'  ],
                    S_xy    = cap['tCp' ],
                    S_x2y   = cap['t2Cp'],
                    S_x3y   = cap['t3Cp'],
                    S_x4y   = cap['t4Cp'],
                    S_x5y   = cap['t5Cp'],
                    )
            try:
                if parsed_args.poly == -1:
                    ll.append([0, 0, 0, 0, 0, 0])
                if parsed_args.poly == 0:
                    res = lin_reg0(**capsums)
                    ll.append([*res, 0, 0, 0, 0, 0])
                if parsed_args.poly == 1:
                    res = lin_reg1(**capsums)
                    ll.append([*res, 0, 0, 0, 0])
                if parsed_args.poly == 2:
                    res = lin_reg2(**capsums)
                    ll.append([*res, 0, 0, 0])
                if parsed_args.poly == 3:
                    res = lin_reg3(**capsums)
                    ll.append([*res, 0, 0])
                if parsed_args.poly == 4:
                    res = lin_reg4(**capsums)
                    ll.append([*res, 0])
                if parsed_args.poly == 5:
                    res = lin_reg5(**capsums)
                    ll.append(res)
            except ZeroDivisionError:
                ll.append([0, 0, 0, 0, 0, 0])
            if parsed_args.mpv:
                ll[-1][0] = capsums['mode']
            progress_bar.update()
        biaslist = next(zip(*ll))
        bias = np.average(biaslist)
        for l in ll:
            l[0] -= bias
        caldat[b_n].append(ll)

res = pprint.pformat(caldat, width=150).replace("'", '"')
print(res)
